import p1_img from "./quaitho.jpg";
import p2_img from "./quaibup.jpg";

let all_product = [
  {
    id: 1,
    name: "Quai Thỏ",
    category: "quaitho",
    image: p1_img,
    price: 5,
  },
  {
    id: 2,
    name: "Quai Búp",
    category: "quaibup",
    image: p2_img,
    price: 5,
  },
];

export default all_product;
